import { Divider, Stack, Typography } from '@mui/material';
import Container from '@mui/material/Container';
import Avatar from '@mui/material/Avatar';
import axios from 'axios';
import { useEffect, useState } from 'react';

export default function StatusAntenas() {
    const [antenas,setAntenas]=useState([])

    useEffect(()=>{
    axios.get('http://localhost:5000/Antenas')
    .then((response)=>{
        console.log(response.data);
        setAntenas(response.data)
    });
},[]);
    return (
        antenas.map((ant)=>(
        <div>
            <Container >
                <Stack direction='row' spacing={20}   >
                    <Stack direction='column' spacing={3}   >
                    <Avatar sx={{ width: 200, height: 200 }} alt="Remy Sharp" src="/static/images/avatar/1.jpg" />

                    </Stack>

                    <Stack direction='column' spacing={3} >
                        <Typography>Nome:</Typography>
                        <Typography>Status</Typography>
                        <Typography>Latitude:</Typography>
                        <Typography>Longitude:</Typography>
                        <Typography>Data da mudança:</Typography>
                        <Typography>Data de Instalação:</Typography>
                        <Typography>Data Desativação:</Typography>
                    </Stack>

                </Stack>

                <Divider />
            </Container >


        </div >
        ))
    )
}
